import React from "react";
import './Movies.css'
import MoviesList from './movieslist/movieslist'

import MoviesFilters from "./moviesfilters/MoviesFilters";

function Movies() {
    return ( 
        <div className="movies-container">

            <MoviesFilters/>
            <MoviesList/>
        
        </div>
     );
}

export default Movies;
